import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';


let userData = [
    {"id": 1, "name": "Dmitri"},
    {"id": 2, "name": "Svetlana"},
    {"id": 3, "name": "Nauryz"},
    {"id": 4, "name": "Dinmukhamed"},
    {"id": 5, "name": "Mukhit"}
]

let messageData = [
    {"id": 1, "message": "Yo"},
    {"id": 2, "message": "Hello"},
    {"id": 3, "message": "How are you"}
]


let postsData = [
    {"id": 1, "message": "Hello, how are you?", "likesCount": 5},
    {"id": 2, "message": "My, first post!", "likesCount": 2},
    {"id": 3, "message": "Hello, everyone", "likesCount": 10},
]

ReactDOM.render(<App userData = {userData} messageData = {messageData} postsData = {postsData}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
